// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MovieList from "./components/MovieList";
import Controller from "./components/Controller";
import "./App.css";

function App() {
  // 예시 데이터
  const movies = [
    {
      id: 1,
      title: "Movie 1",
      director: "Director 1",
      writer: "Writer 1",
      actor: "Actor 1",
      year: 2022,
      quote: "Quote 1",
    },
    // 추가적인 데이터
  ];

  return (
    <div className="App">
      <section className="Controller">
        <Router>
          <Routes>
            <Route path="/" element={<Controller />} />
          </Routes>
        </Router>
      </section>

      <section className="List movie-table">
        <MovieList movies={movies} />
      </section>
    </div>
  );
}

export default App;
